Plot:
De serie gaat over een &quot;computernerd&quot; die werkt bij een Buy-More winkel. Op een dag ontvangt Chuck een e-mail van een oude vriend die bij de CIA werkte, deze e-mail bevat alle grote geheimen van de wereld, deze geheimen worden ook wel &quot;the intersect&quot; genoemd. Door deze e-mail te openen bevat Chucks brein al deze gegevens. Alle geheime diensten zoals de NSA en de CIA zijn opzoek naar deze intersect, met alle gevolgen van dien.

Deze aflevering:

Chuck probeert een romatisch moment te vinden om iets aan Sarah te vragen terwijl ze een nano-chip zoeken in een franse wijngaard. Lester vraagt Big Mike om liefdes advies.

